import { Typography } from '@material-ui/core'
import React from 'react'

const AllUser = ({userId,name,profilePicture}) => {
  return (
    // <Link to={`/${userId}`}>
    //  <img src={profilePicture} style={height='3vmax',width='3vmax'}/>
    //  <Typography>{name}</Typography>
    // </Link>
    <div >
      <img
        src={profilePicture}
        style={((height = '3vmax'), (width = '3vmax'))}
      />
      <Typography>{name}</Typography>
    </div>
  );
}

export default AllUser
